INSERT INTO "item" VALUES ('101', 'canine01', 'Beach Dog', 'A great dog to lay in the Sun with, chases a frisbee like a champ, and can swim like a shark. Heck, he can ride a surfboard if you dont mind sharing.', 'images/harrison.jpg', 'images/harrison-s.jpg', '250.00', '31', '31', '15', '5', '0');
