INSERT INTO "item" VALUES ('103', 'canine01', 'Intense Worker Dog', 'My dog is full on energy and intensity. He needs a constant challenge to keep him happy. Great for a farm or house in the country. Bring him to work with you.', 'images/hunter.jpg', 'images/hunter-s.jpg', '500.00', '33', '33', '15', '5', '0');
INSERT INTO "item" VALUES ('104', 'canine02', 'Old Dog', 'This old geezer just wants to sleep at your feet. Slip him some food under the table and watch him wag his tail. Great dog for someone who retired before the dot-com bubble burst. A partner to loaf with.', 'images/jack.jpg', 'images/jack-s.jpg', '215.00', '34', '34', '15', '7', '0');
INSERT INTO "item" VALUES ('105', 'canine01', 'Female Huskie', 'Live in a cold area? This dog has her own winter jacket. She loves the snow. She even loves to eat the snow. One time, I saw her eat a whole snowman ...it was crazy fun to watch.', 'images/lady.jpg', 'images/lady-s.jpg', '2000.00', '35', '35', '15', '5', '0');
INSERT INTO "item" VALUES ('106', 'canine01', 'Rasta Dog', 'Hey mon! Want a dog to chill with. This dog wants the rasta life. You can see it in her eyes. The ocean, the sunshine, all you need is this dog to be complete.', 'images/maggie.jpg', 'images/maggie-s.jpg', '400.00', '36', '36', '15', '3', '0');
INSERT INTO "item" VALUES ('107', 'canine01', 'Tough Dog', 'Need a guard dog? An excellent guard dog that would love to sit next to you and watch reruns of police shows on TV. And loves kids. Its like having a trusted babysitter to watch your kids and home.', 'images/marianna.jpg', 'images/marianna-s.jpg', '500.00', '37', '37', '15', '7', '0');
INSERT INTO "item" VALUES ('108', 'canine02', 'Sad Puppy', 'Help to put a smile on the face of this puppy. What? You did not know dogs could smile? Well, see what happens when you drop some steak on the floor!', 'images/puppup.jpg', 'images/puppup-s.jpg', '99.00', '38', '38', '15', '6', '0');
INSERT INTO "item" VALUES ('109', 'canine01', 'Speedy Dog', 'A great runner for a fast owner. This is the fastest dog I have ever seen. Its naturally fast and does not take steroids to improve its performance.', 'images/rita.jpg', 'images/rita-s.jpg', '25.00', '39', '39', '15', '9', '0');
