INSERT INTO "item" VALUES ('111', 'canine01', 'Sleepy Dog', 'This sleepy dog is perfect for a relaxed home. Plus she just seems to love old music. Anytime she is near an elevator, she just wags her tail waiting to hear that old music.', 'images/thaidog.jpg', 'images/thaidog-s.jpg', '1000.00', '41', '41', '15', '3', '0');
INSERT INTO "item" VALUES ('112', 'canine01', 'Lazy Dog', 'OK, I can not get this dog to fetch the newspaper. Not even for a doggy biscuit. His name is "Rhymes". He is so lazy, it drives me crazy.', 'images/dog1.gif', 'images/dog1.gif', '200.00', '42', '42', '15', '9', '0');
