INSERT INTO "item" VALUES ('314', 'fish01', 'Angel Fish', 'I love this fish. But my new roommate has a cat, and the cat just so does not seem to get along with the  fish. At first, I thought the cat was trying to just play with the fish, or maybe learn to swim. And then I remembered that show where they explained that Tuna is the chicken of the sea, but that does not mean its chicken. Not, its fish. And cats love tuna, so then I got scared and realized my fish is in danger. Help me! Buy my little chicken of the sea.', 'images/fish3.gif', 'images/fish3.gif', '100.00', '82', '82', '15', '5', '0');
INSERT INTO "item" VALUES ('315', 'fish02', 'Striped Tropical', 'This large fish needs plenty of room to swim. Either a big aquarium or your bath tub.', 'images/fish4.gif', 'images/fish4.gif', '20.00', '83', '83', '15', '5', '0');
INSERT INTO "item" VALUES ('401', 'reptile02', 'Hawaiian Green Gecko', 'Oloha Wahine! I am from Hawaii. I like to hang out on leaves and just kick back at the beach. You know you can not resist my shiny green skin. So what do you say, want to come visit me?', 'images/hawaiian-lizard-med.jpg', 'images/hawaiian-lizard-thumb.jpg', '110.00', '84', '84', '15', '5', '0');
INSERT INTO "item" VALUES ('402', 'reptile02', 'African Spurred Tortoise', 'Many people get this as a pet, not realizing it will grow over time to be as large as an ottoman. I must confess, that I am one of those people. Which is why I am now trying to sell this tortoise -it is getting big and starting to scare me. Only homes with lots of room please. ', 'images/african-spurred-tortoise.jpg', 'images/african-spurred-tortoise-thumb.jpg', '300.00', '85', '85', '15', '3', '0');
INSERT INTO "item" VALUES ('403', 'reptile02', 'Small Box Turtle', 'Cute little turtle for sale. This box turtle is easy to care for and just needs a good home.', 'images/box-turtle.jpg', 'images/box-turtle-thumb.jpg', '5000.00', '86', '86', '15', '4', '0');
INSERT INTO "item" VALUES ('404', 'reptile02', 'Mexican Redkneed Tarantula', 'No, I am not reptile food! But if you like exotic reptiles, well maybe you would like me too? I promise not to bite you and turn you into spiderman, unless that is what you want. Perhaps you want to climb walls with me?', 'images/mexican-redkneed-tarantula.jpg', 'images/mexican-redkneed-tarantula-thumb.jpg', '530.00', '87', '87', '15', '5', '0');
INSERT INTO "item" VALUES ('405', 'reptile02', 'Large Box Turtle', 'Turtles are very nice creatures. This large Box Turtle is super fast. Well, compared to other turtles in the neighborhood, this is the Cheetah of turtles.', 'images/box-turtle2.jpg', 'images/box-turtle2-thumb.jpg', '5000.00', '88', '88', '15', '4', '0');
INSERT INTO "item" VALUES ('406', 'reptile02', 'California Desert Tortoise', 'An endangered tortoise. We are lookng for a zoo to house this beautiful creature. It has a quite nice disposition and will let children pet its shell to discover the mysteries of biology.', 'images/california-desert-tortoise.jpg', 'images/california-desert-tortoise-thumb.jpg', '599.00', '89', '89', '15', '3', '0');
INSERT INTO "item" VALUES ('407', 'reptile01', 'Florida King Snake', 'This Florida King Snake is really nice. It may look spooky and scare your friends at first, but eventually they will learn to love this slippery snake.', 'images/florida-king-snake.jpg', 'images/florida-king-snake-thumb.jpg', '150.00', '90', '90', '15', '6', '0');
INSERT INTO "item" VALUES ('408', 'reptile01', 'Leopard Gecko', 'My little leopard gecko needs a new home. If you are interested in purchasing this gecko, I advise you to hurry as it is bound to sell fast.', 'images/leopard-gecko.jpg', 'images/leopard-gecko-thumb.jpg', '700.00', '91', '91', '15', '3', '0');
INSERT INTO "item" VALUES ('409', 'reptile02', 'Prehensile Tailed Skink', 'Long Tailed Prehensile Tailed Skink for sale. This is the longest tail I have ever seen on a lizard. It goes on for days. Notice the gloves? Be aware of the sharp claws when holding this lizard, even though she is very nice.', 'images/prehensile-tailed-skink.jpg', 'images/prehensile-tailed-skink-thumb.jpg', '800.00', '92', '92', '15', '6', '0');
INSERT INTO "item" VALUES ('410', 'reptile02', 'African Spurred Tortoise', 'This is not a turtle, it is an African Spurred Tortoise. It grows to get really large. Maybe you have a big yard and can really care for this tortoise? If so, now is your chance to buy it.', 'images/african-spurred-tortoise2.jpg', 'images/african-spurred-tortoise2-thumb.jpg', '125.00', '93', '93', '15', '5', '0');
INSERT INTO "item" VALUES ('411', 'reptile02', 'Box Turtle', 'This box turtle needs a new home. I am moving and unfortunately must sell all my animals.', 'images/box-turtle3.jpg', 'images/box-turtle3-thumb.jpg', '900.00', '94', '94', '15', '5', '0');
INSERT INTO "item" VALUES ('412', 'reptile01', 'Prehensile Tailed Skink', 'My lizard is really cool and all my school friends are really impressed when I bring it to show-and-tell. But, the other day at home, he escaped from his cage and it REALLY freaked my mom out. Now she is mad at me. Sigh, since I can not sell my Mom, please buy my lizard.', 'images/prehensile-tailed-skink2.jpg', 'images/prehensile-tailed-skink2-thumb.jpg', '5000.00', '95', '95', '15', '3', '0');
INSERT INTO "item" VALUES ('413', 'reptile01', 'Leopard Gecko', 'Are you seeing spots in front of your eyes? No you are not sleepy. That is just the affect of my gecko and his beautiful spotted skin.', 'images/leopard-gecko2.jpg', 'images/leopard-gecko-thumb2.jpg', '1200.00', '96', '96', '15', '4', '0');
INSERT INTO "item" VALUES ('414', 'reptile01', 'Guinea Pig', 'Oh no! I dont like snakes at all. Why am I here in this list surrounded by serpents? Help save me! Take me home to a nice warm cage with fresh newspaper. ', 'images/guinea-pig.jpg', 'images/guinea-pig-thumb.jpg', '1000.00', '97', '97', '15', '4', '0');
INSERT INTO "item" VALUES ('415', 'reptile01', 'Iron Dragon', 'Just look at this fierce beast. This is so tough its like a secret military weapon.', 'images/dragon-iron-med.jpg', 'images/dragon-iron-thumb.jpg', '500.00', '98', '98', '15', '3', '0');
INSERT INTO "item" VALUES ('416', 'reptile01', 'Green slider', 'This snake looks like a lizard! It must be rare since I have never seen one like it.', 'images/lizard3.gif', 'images/lizard3.gif', '10.00', '99', '99', '15', '4', '0');
INSERT INTO "item" VALUES ('417', 'reptile02', 'Green Iguana', 'This is one proud and tough lizard. He holds his head high in any circumstance.', 'images/lizard1.gif', 'images/lizard1.gif', '2100.00', '100', '100', '15', '5', '0');
INSERT INTO "item" VALUES ('418', 'reptile02', 'Iguana', 'My iguana needs a home. His tail is really long. He is very nice.', 'images/lizard2.gif', 'images/lizard2.gif', '500.00', '101', '101', '15', '5', '0');
INSERT INTO "item" VALUES ('419', 'reptile02', 'Frog', 'This little green frog was rescued from the chef in the kitchen of a french restaurant. If I had not acted quickly, his legs would have been appetizers. Now for just a small fee you can buy him as your pet.', 'images/frog1.gif', 'images/frog1.gif', '1500.00', '102', '102', '15', '3', '0');
